import React from 'react';
import Menubar from '../components/Menubar';
import { Jumbotron, Container, Card, CardHeader, CardFooter, CardBody,
   CardTitle, CardText } from 'reactstrap';

function Home({ data }) {
   return (
      <>
         <Menubar />
         <Jumbotron fluid className="list">
            <Container>
               <h1>Minhas metas</h1>
               {data.metas.map(meta => (
                  <Card key={meta._id}>
                     <CardHeader>{meta.name}</CardHeader>
                     <CardBody>{meta.description}</CardBody>
                     <CardFooter>{meta.status}</CardFooter>
                  </Card>
               ))}
            </Container>
         </Jumbotron>
      </>
   )
}

export async function getServerSideProps() {
   const response = await fetch(`http://localhost:8080/metas`)
   const data = await response.json()

   return { props: { data } }
}

export default Home
